          <p className="">
            <strong>Genres :</strong>{" "}
            {`${typeof genres === "string" ? genres : genres.join(", ")}`}
          </p>
        }
        
        </div>
      </div>
      
        
          
            
          </Link>
        
      
    </div>
  );
}
